import React from "react";
import WeatherSearch from "./WeatherSearch";

import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          This project was coded by Thandie R-mane and it is <a>open sourced</a>{" "}
          on Github
        </p>
        <WeatherSearch city="Gaborone" />
      </header>
    </div>
  );
}

export default App;
